import logo from './logo.svg';
import './App.css';
import { Router, Link } from '@reach/router';
import ShowAll from './components/Sho';

function App() {
  return (
    <div className="App">
      <br/>
      <br/>
      <h1>Pet Shelter</h1>
      <Router>
      <ShowAll path="/"></ShowAll>

      </Router>
    </div>
  );
}

export default App;
